import {Link, NavLink} from "react-router-dom";
import LOGO from "../img/logo.svg";
import GridViewIcon from '@mui/icons-material/GridView';

const Navbar=()=>{
    return(
        <div className=" "> 
        
        <Link to="/">
             <header className=" bg-white w-60 text-black  sticky top-0  text-xl  text-sky-600 rounded-xl" style={{height:"100vh" }}>
                    <nav className=" flex  flex-col">
                        <div className="flex flex-col ">
                            <img src={LOGO} className="mx-auto mt-10 " ></img>
                            <NavLink to="/"  className={({ isActive }) => (isActive ? " border-solid border-6 w-30 mx-auto mt-20 px-6 py-2 bg-slate-300 text-black  " : " border-solid border-6 w-20 mx-auto  mt-20 hover:bg-sky-700")}><svg data-testid="GridViewIco"></svg >Dashboard</NavLink>
                            <NavLink to="/Courses"  className={({ isActive }) => (isActive ? "flex border-solid border-6 w-60 px-12 py-4  bg-slate-300 text-black " : "flex border-solid border-6 w-60 px-6 py-4  hover:bg-sky-700")} >Courses</NavLink>
                            <NavLink to="/Todo"  className={({ isActive }) => (isActive ? "flex border-solid border-6 w-60 px-12 py-4  bg-slate-300 text-black " : "flex border-solid border-6 w-60 px-6 py-4  hover:bg-sky-700")} >To-do</NavLink>
                        </div>
                        <div className="mt-48">
                            <NavLink to="/Chat"  className={({ isActive }) => (isActive ? "flex border-solid border-6 w-60 px-12 py-4 bg-slate-300 text-black " : "flex border-solid border-6 w-60 px-6 py-4 hover:bg-sky-700")} >Chat</NavLink>
                            <NavLink to="/Meet"  className={({ isActive }) => (isActive ? "flex border-solid border-6 w-60 px-12 py-4 bg-slate-300 text-black" : "flex border-solid border-6 w-60 px-6 py-4 hover:bg-sky-700")} >Meet</NavLink>
                        </div>
                    </nav>
             </header>
        </Link>

        </div>
    )
}

export default Navbar;
